import { useSelector } from 'react-redux';

const Dashboard = () => {
    const user = useSelector(state => state.auth.user);
    const playlist = user.playlist.map(element => <div>{element}</div>)
    return (<div>
            <SpotifyPlayer
        uri={element}
        size={{
          width: '20%',
          height: 300,
        }}
        view={'list'}
        theme={'black'}
      />
        </div>);
};

export default Dashboard;
